$(document).ready(function () {
    $(document).on("scroll", onScroll);

    $('a[href^="#"]').on('click', function (e) {


    	if($('.js-menu-active').hasClass('js-menu-active')) {

			$('html').removeClass('js-menu-active');
			$('.hamburger').removeClass('is-active');

	        e.preventDefault();
	        $(document).off("scroll");
	        
	        $('a').each(function () {
	            $(this).removeClass('js-section-active');
	        })
	        $(this).addClass('js-section-active');
	      
	        var target = this.hash,
	            menu = target;
	        $target = $(target);
	        $('html, body').stop().delay(400).animate({
	            'scrollTop': $target.offset().top -71
	        }, 500, 'swing', function () {
	            $(document).on("scroll", onScroll);
	        });
    	} else {
	        e.preventDefault();
	        $(document).off("scroll");
	        
	        $('a').each(function () {
	            $(this).removeClass('js-section-active');
	        })
	        $(this).addClass('js-section-active');
	      
	        var target = this.hash,
	            menu = target;
	        $target = $(target);
	        $('html, body').stop().animate({
	            'scrollTop': $target.offset().top -71
	        }, 500, 'swing', function () {
	            $(document).on("scroll", onScroll);
	        });    		
    	}
    });
});


function onScroll(event){
    var scrollPos = $(document).scrollTop();
    $('.c-header_menu li.c-page a').each(function () {
        var currLink = $(this);
        var refElement = $(currLink.attr("href"));
		if (refElement.position().top <= scrollPos  + 72 && refElement.position().top + 72 + refElement.height() > scrollPos ) {
            $('.c-header_nav_ul ul .c-header_nav_li a').removeClass("js-section-active");
            currLink.addClass("js-section-active");
        }
        else{
            currLink.removeClass("js-section-active");
        }
    });




}


